import React from "react";
import "./App.css"

const App = () => {
    let date = new Date(); 
    let hh = date.getHours();
    let mm = date.getMinutes(); 
    let ss = date.getSeconds()
    return (
        <>
        <div className="time"> <h1>{hh}:{mm}:{ss}</h1> </div>
        <div className="btn">  <button>get time!</button></div>
        </>
    )
}
export default App
